INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (11, 1, "わぁ、絵本に出てきそうな\n大きなケーキですね。\nもしかして、\n私の誕生日のために……？", 0, 0.5, 103811, 26214063, 0, 10, 26214, 1);
