INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (11, 1, "私もだけど、彼とリンちゃんも準備を\nがんばったのよ♪\nふふっ、シオリちゃんのために～って\n張り切ってたのよね？", 0, 0.5, 105211, 26214073, 0, 10, 26214, 1);
