INSERT INTO `v1_4af6505a5f3fb22aa25722577b0b280918c4447c96d7be89e1ed39038dd585dd` VALUES (11, 1, "それならプリンがいいの～！\nこのケーキと同じくらい、でっかい\nプリンが食べたいの～！", 0, 0.5, 100711, 31114076, 0, 10, 31114, 1);
